import React, { Component } from 'react';
import SelectPanel from "./components/select/SelectPanel";
import {Link} from "react-router-dom";
class SelectPanelPage extends Component<any, any> {
    render() {
        return (
            <div className={"h-full w-full flex flex-col justify-center items-center  bg-amber-100"}>
                <div className={"text-5xl text-red-950 mt-4 p-8"}>F1 Tracker</div>
                <ul>
                    <li>
                        <Link to="/">Home</Link>
                    </li>
                    <li>
                        <Link to="/custominfo">Custom Info</Link>
                    </li>
                </ul>
                    <SelectPanel/>
            </div>
        );
    }
}

export default SelectPanelPage;
